import React, { Component } from 'react'
import './App.css'


export default class App extends Component {
  msgPrint () {
    console.log('oioi')
  }
  msgPrint2 () {
    console.log('sei la')
  }
  msgPrint3 () {
    console.log('bom dia')
    console.log(this)
  }
  render() {
    console.log(this)
    return (
      <div>
        <button onClick={this.msgPrint}>Mybutton</button>
        <button onClick={this.msgPrint2}>Mybutton</button>
        <button onClick={this.msgPrint3}>Mybutton</button>
      </div>
    )
  }
}
